import Search from "../actions/Search";
import Add from "../actions/Add";

export default function Nav() {

    return(
        <>
            <div className="nav-logo">
                <a href="../App.js"><img src="../images/favooks.png" alt="logo"/></a>
                <div className="nav">
                    <a href="../actions/Add.js"><img src="../images/plus.png" alt="dodaj"/></a>
                    {/*<a href="../actions/Add.js"><img src="../images/plus.png" alt="dodaj"/></a>*/}
                    <Search/>
                </div>
            </div>
        </>
    )
};
